const AppLink = {
  getAddrLink (status) {
    const address = []
    if (status === 'Admin') {
      address.push(
        { index: '600', name: 'Menu', icon: 'fas fa-toolbox', link: 'AdminMenu' }
      )
    }
    if (status === 'User') {
      address.push()
    }
    // default
    address.push(
      { index: '100', name: 'Home', icon: 'fas fa-home', link: 'Home' }
    )
    return address
  }
}
export default AppLink
